import types from "./../types/typeOfActions";
import callApi from "./../callApi/callApi";
class User {
  getAllUser = () => {
    return async (dispatch) => {
      let userList = await callApi(`http://localhost:9000/get-user`, `GET`);
      console.log(userList)
    };
  };
}
export default new User();
